import React from 'react';
import Link from 'next/link';
import { Row, Col, Divider,Typography,Carousel,Timeline } from 'antd';

const { Title } = Typography;

const IndexPage = ({props}) => {
    return (
        <div style={{margin:"0 150px"}}>
            여기서 부터 새로운 시작을 해보도록 하겠습니다.
            <Row>
                <Col xs = {24}  sm = {24}  md = {24}  lg = {12}>
                    <img alt="fortest" src={require('../public/1.png')} style={{width:"100%", height:"400px"}}/>
                </Col>
                <Col xs = {24}  sm = {24}  md = {24}  lg = {12}>
                    <img alt="fortest" src={require('../public/2.png')} style={{width:"100%", height:"400px"}}/>
                </Col>
            </Row>
        </div>
    )
  }

  export default IndexPage;
